Templates are one of C++’s most powerful and frightening features. They let you write generic code that can work with multiple data types without duplication. But they also have the potential to turn your code into an unreadable mess of cryptic compiler errors if misused. In these examples, we’ll look at two ways templates are used: Function Templates – Making a single function that works with multiple types. Class Templates – Making a class that can handle multiple data types dynamically. // Function templates: subtract() #include <iostream>
#include <vector> const int N = 40; template <typename T>
T substract(const T data[], int n, T s = 0) { for (int i = 0; i < n; ++i) { s = s - data[i]; } return s;
} int main() { std::cout << "template for substract()" << std::endl; int a[] = {1,2,3}; double b[] = {2.1, 2.2, 2.3}; std::cout << substract(a, 3) << std::endl; std::cout << substract(b, 3) << std::endl; return 0;
} Key Takeaways template – This is the template declaration. T is a placeholder for any data type (int, double, float, etc.). When calling substract(), the compiler automatically replaces T with the correct type. Function works for multiple data types substract(a, 3) works for int. substract(b, 3) works for double. Why templates instead of function overloading? Without templates, you’d have to write separate functions for int, double, float, etc. Templates let you write the function once and use it for any compatible type. Is this just like inline? No, but function templates can be inlined by the compiler if they are small. The compiler generates a separate function for each unique type used. This means substract and substract are compiled separately.

